import React from 'react';

import Person from './Person'

const Persons = ({ filteredPersons, concatPersonLists }) => filteredPersons.map(person => {
    console.log(person.id);
    return <Person key={person.id} person={person} concatPersonLists={concatPersonLists} />
})

export default Persons
